// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract GithubIdToAddrMapping {
  event NewRecord(address indexed addr, uint256 indexed githubId);

  address admin;

  constructor(address _admin){
    admin = _admin;
  }
  function addRecord(uint256 githubId, uint8 v, bytes32 r, bytes32 s) public {
    bytes32 msgHash = keccak256(abi.encodePacked(msg.sender, githubId));
    require(admin == ecrecover(msgHash, v, r, s));

    emit NewRecord(msg.sender, githubId);
  }
}
